// src/Login.js
import React, { useState, useEffect } from 'react';
import { Link  } from 'react-router'; // Updated to use 'react-router-dom' instead of 'react-router'
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import {useNavigate} from 'react-router-dom';



function Login  () {
function convertToSolrQuery(query, defaultField, boost) {
    if (!query) {
      return defaultField ? "" : "*:*";
    }

    query = query.trim(); // Remove leading/trailing whitespace

    // Handle phrase queries
    if (query.startsWith('"') && query.endsWith('"')) {
      return `${defaultField}:${query}${boost ? `^${boost}` : ""}`;
    }

    // Handle explicit field searches
    if (query.includes(":")) {
      return `${query}${boost ? `^${boost}` : ""}`;
    }

    // Handle range queries (e.g., "under 300", "between 100 and 200")
    const underMatch = query.match(/under (\d+)/i);
    if (underMatch) {
      const upperLimit = underMatch[1];
      const searchTerm = query.replace(underMatch[0], "").trim();
      var part1 = searchTerm[0].toUpperCase();
      var part2 = searchTerm.substring(1);
      return `${defaultField}:*${
        part1 + part2
      }* AND price:[* TO ${upperLimit}]`;
    }

    const betweenMatch = query.match(/between (\d+) and (\d+)/i);
    if (betweenMatch) {
      const lowerLimit = betweenMatch[1];
      const upperLimit = betweenMatch[2];
      const searchTerm = query.replace(betweenMatch[0], "").trim();
      var part1 = searchTerm[0].toUpperCase();
      var part2 = searchTerm.substring(1);

      return `${defaultField}:*${
        part1 + part2
      }* AND price:[${lowerLimit} TO ${upperLimit}]`;
    }

    // // Handle boolean operators
    // query = query.toUpperCase();
    // query = query.replace(/ AND /g, " AND ");
    // query = query.replace(/ OR /g, " OR ");
    // query = query.replace(/ NOT /g, " NOT ");

    // // Handle wildcards
    // if (query.includes("*") || query.includes("?")) {
    //   return `${defaultField}:${query}${boost ? `^${boost}` : ""}`;
    // }


    var part1 = query[0].toUpperCase();
    var part2 = query.substring(1).toLowerCase();
    return `description:*${part1+part2}*${boost ? `^${boost}` : ""}`



  }
  useEffect(() => {
    // Check if the JWT token is present in localStorage
    const token = localStorage.getItem('authToken');
    if (!token) {
      // Redirect to the login page if the token is not found
      navigate('/login');
    }
  }, [navigate]); //


  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  // const [error, setError] = useState('');


  const handleSubmit = (e) => {
    e.preventDefault();

    var value = {
      "email":email,
      "password":password
    }
    var url = 'api/login';
    fetch(url, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(value),
    }).then(
      (res)=>{
        if(!res.ok){
          alert("Something wrong");
          console.error(res);
        }
        return res.json();
      }
    ).then(
      (data)=>{
        if (data.token) {
          // Save the JWT token in localStorage or sessionStorage
          localStorage.setItem('authToken', data.token); // Or use sessionStorage
          // Navigate to the homepage upon successful login
          navigate('/');
        } else {
        }
        console.log(data);
      }
    )
  };



  return (
    <div className="container d-flex justify-content-center align-items-center vh-100">
      <div className="card p-4 w-100" style={{ maxWidth: '400px' }}>
        <h2 className="text-center mb-4">Login</h2>
        {/* {error && <div className="alert alert-danger">{error}</div>} */}
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label htmlFor="email" className="form-label">Email</label>
            <input
              type="email"
              className="form-control"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Enter your email"
            />
          </div>
          <div className="mb-3">
            <label htmlFor="password" className="form-label">Password</label>
            <input
              type="password"
              className="form-control"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Enter your password"
            />
          </div>
          <button type="submit" className="btn btn-primary w-100">Login</button>
        </form>
        <div className="mt-3 text-center">
          <p>Don't have an account?</p>
          <Link to="/signup" className="btn btn-link">Sign Up</Link>
        </div>
      </div>
    </div>
  );
};

export default Login;
